export const useHover = ({ target, options = {} }: UseHoverOptionsType) => {
  const { onEnter, onLeave, onChange } = options;
  const [isHover, setIsHover] = useState(false);

  useEventListener(
    'mouseenter',
    () => {
      setIsHover(true);
      onEnter?.();
      onChange?.(true);
    },
    { target: target },
  );

  // DOM \u652F\u6301\u4F20\u5165 Function \u6A21\u5F0F
  useEventListener(
    'mouseleave',
    () => {
      setIsHover(false);
      onLeave?.();
      onChange?.(false);
    },
    { target: target },
  );

  return { isHover };
};
